function ShoppingItem({cartItems}) {

  return (
    <div>
      <div>
        {cartItems.length === 0
          ? (<div>cart item 0</div>)
          : (<div>{cartItems.length} in this cart</div>)
        }
      </div>
      <div>
        {cartItems.map(item => {
          <div key={item.id}>
            
          </div>
        })}
      </div>

    </div>
  );
}

export default ShoppingItem
